import React, { useEffect, useState } from 'react'
import axios from 'axios'

const PoliceSearchForm = ({ token, currentUser }) => {
  const [objetos, setObjetos] = useState([])

  const fetchObjetos = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/objetos')
      setObjetos(res.data)
    } catch (err) {
      alert('Error al obtener objetos')
    }
  }

  const handleDelete = async (id) => {
    if (!window.confirm('¿Seguro que querés eliminar este objeto?')) return
    try {
      await axios.delete(`http://localhost:5000/api/objetos/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      })
      fetchObjetos()
    } catch (err) {
      alert('No tenés permiso para eliminar este objeto')
    }
  }

  useEffect(() => {
    fetchObjetos()
  }, [])

  return (
    <div className="p-4">
      <h2 className="text-lg mb-2">Bienes registrados</h2>
      <ul className="space-y-2">
        {objetos.map((obj) => (
          <li key={obj._id} className="border p-2 rounded">
            <p><strong>Elemento:</strong> {obj.elemento}</p>
            <p><strong>Marca:</strong> {obj.marca}</p>
            <p><strong>Denunciante:</strong> {obj.denunciante}</p>
            {currentUser === 'GustavoPeralta' && (
              <button
                className="bg-red-500 text-white px-2 py-1 mt-2 rounded"
                onClick={() => handleDelete(obj._id)}
              >
                Eliminar
              </button>
            )}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default PoliceSearchForm
